import React from "react"
import ReactDOM from "react-dom"
import ContactCard from "./contact"
import "./styles/main.css"

function App(){
    return(
        <div class="main">
            <ContactCard/>
        </div>
    )
}



ReactDOM.render(<App/>,document.getElementById("root"))
